import React from 'react';


const JobDropDownMenu = () => (
  <>
    <div class="dropdown">
    <button class="dropbtn">Dropdown</button>
    <div class="dropdown-content">
      <button>IT</button>
      <button>Engineering</button>
      <button>Biology</button>
    </div>
  </div>
</>
);




export default JobDropDownMenu;
